pleted"},"tags":[]},"source":["The two cutomer types follow almost similar patterns and the casual cutomers exceed the members most of the time. However the member customers exceed the casual through the hours from 4am to 8am during the time when the workers go to their work. Also, the difference between the casual and the member increase heavily during the working hours.\n","\n","The member customers' number of rides exceed those of the casual customers almost all of the day. However, the difference increases significantly during the hours of going to work and coming back from work"]},{"cell_type":"markdown","id":"1ade5ab6","metadata":{"papermill":{"duration":0.022384,"end_time":"2022-09-17T14:25:55.728849","exception":false,"start_time":"2022-09-17T14:25:55.706465","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"fba2393d","metadata":{"papermill":{"duration":0.022808,"end_time":"2022-09-17T14:25:55.774079","exception":false,"start_time":"2022-09-17T14:25:55.751271","status":"completed"},"tags":[]},"source":["### Weekday"]},{"cell_type":"code","execution_count":34,"id":"70bc386f","metadata":{"execution":{"iopub.execute_input":"2022-09-17T14:25:55.822561Z","iopub.status.busy":"2022-09-17T14:25:55.820849Z","iopub.status.idle":"2022-09-17T14:25:56.403236Z","shell.execute_reply":"2022-09-17T14:25:56.401235Z"},"papermill":{"duration":0.609369,"end_time":"2022-09-17T14:25:56.405806","exception":false,"start_time":"2022-09-17T14:25:55.796437","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'start_weekday'. You can override using the\n","`.groups` argument.\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZYBUZRuH8ftMbycstdTS3UiJhQIigrSEoLSoiCggSJdISYkvShg0iKCAAlIK\nqIBJIw1Su7AdU++HWZeFhd3ZmlnOXr9PMyee5z7nGZj/nhrFbrcLAAAAHn4adxcAAACAnEGw\nAwAAUAmCHQAAgEoQ7AAAAFSCYAcAAKASBDsAAACVINgBAAC