etadata":{"papermill":{"duration":0.030815,"end_time":"2022-09-17T14:27:16.730037","exception":false,"start_time":"2022-09-17T14:27:16.699222","status":"completed"},"tags":[]},"source":["The previous figures show that the total duration and the number of trips for each bike type\n","differ from month to month for both customer types. They increase in Summer and Autumn and decrease in winter and spring. Also, they peak on July."]},{"cell_type":"markdown","id":"4a19b64f","metadata":{"papermill":{"duration":0.030384,"end_time":"2022-09-17T14:27:16.790364","exception":false,"start_time":"2022-09-17T14:27:16.75998","status":"completed"},"tags":[]},"source":["<a id='conclusions'></a>\n","## Conclusions\n","\n",">   The summary of the ride length and the number of rides shows that, generally the casual customers have longer total and avgerage ride length while the member customers have more number of trips.\n","That Trend affects all the results except some certain hours, weekdays and month. The trend is followed along the day except during the going-to-work hours where the total trip duration for the member customers is higher and their number of trips is significantly high. While the total trip duration of the casual members gets significantly higher during the work hours and their number of trips is higher than the members at night. There's another exceptiong along the week during the weekends where the number of trips for the casual customers is higher than that of the member customers and their trip duration gets significantly high. Also, the total trip duration during the winter becomes higher than the casuals', where casual's number of trips beats the members' during the summer.\n","\n","> The trend exceptions show strong relation between the work hours and days with the type of customers. The members trips are more during the work commuting hours. Also, their trip drop significantly during the weekends which may indicate that they use their bike to commute to work. On the other hand, the casual customers' trips increase during the work hours and workdays, which may indicate that they use their bike for sport. "]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":641.522922,"end_time":"2022-09-17T14:27:17.24343","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-09-17T14:16:35.720508","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}